create table if not exists bookpad.follow(
    ID_who_i_follow int not null,
    ID_followed_by  int not null,
    primary key (ID_who_i_follow, ID_followed_by),
    foreign key (ID_followed_by) references bookpad.users (id) on update cascade on delete cascade,
    foreign key (ID_who_i_follow) references bookpad.users (id) on update cascade on delete cascade
);

insert into bookpad.follow (ID_who_i_follow, ID_followed_by)
values  (4, 1);

create index ID_who_is_followed
    on bookpad.follow (ID_followed_by);

create table if not exists bookpad.stories(
    id         int auto_increment primary key,
    title      varchar(50)   not null,
    plot       mediumtext    not null,
    n_like     int default 0 null,
    n_comments int default 0 null,
    n_savings  int default 0 null,
    cover      longblob      null,
    ID_user    int           not null,
    ID_genre   int           not null,
    dt         datetime      null,
    constraint title
    unique (title),
    foreign key (ID_user) references bookpad.users (id) on update cascade on delete cascade,
    foreign key (ID_genre) references bookpad.genres (id)
);

