create index ID_story
    on bookpad.chapters (ID_story);

create table if not exists bookpad.comments(
    id       int auto_increment primary key,
    content  text not null,
    data_cm  date not null,
    ID_user  int  not null,
    ID_story int  not null,
    constraint comments_ibfk_1
    foreign key (ID_user) references bookpad.users (id)
    on update cascade on delete cascade,
    constraint comments_ibfk_2
    foreign key (ID_story) references bookpad.stories (id)
    on update cascade on delete cascade
);

