create table if not exists bookpad.has_like(
    ID_story int not null,
    ID_user  int not null,
    primary key (ID_story, ID_user),
    constraint has_like_ibfk_1
    foreign key (ID_user) references bookpad.users (id) on update cascade on delete cascade,
    constraint has_like_ibfk_2
    foreign key (ID_story) references bookpad.stories (id) on update cascade on delete cascade
);

